// HasSubdistrict applies the HasEdge predicate on the "subdistrict" edge.
func HasSubdistrict() predicate.PMILocation {
	return predicate.PMILocation(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, SubdistrictTable, SubdistrictColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSubdistrictWith applies the HasEdge predicate on the "subdistrict" edge with a given conditions (other predicates).
func HasSubdistrictWith(preds ...predicate.Subdistrict) predicate.PMILocation {
	return predicate.PMILocation(func(s *sql.Selector) {
		step := newSubdistrictStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.PMILocation) predicate.PMILocation {
	return predicate.PMILocation(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.PMILocation) predicate.PMILocation {
	return predicate.PMILocation(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.PMILocation) predicate.PMILocation {
	return predicate.PMILocation(sql.NotPredicates(p))
}
